INSERT INTO `myaac_news` VALUES (5,'Bem vindo ao Middle Earth Server!','<p style=\"text-align: center;\">Boas vindas ao Middle Earth Server!</p>\r\n<p style=\"text-align: center;\">Para jogar em nosso servidor, voc&ecirc; precisar&aacute; do client disponivel na aba de downloads.<br /><img src=\"https://www.tibiawiki.com.br/images/thumb/7/76/Tibia_icon.png/120px-Tibia_icon.png?20190711200111\" alt=\"Client Icon\" /><br /><a href=\"../?download_client\">Download do Client </a><br /><br />Abaixo deixarei listados alguns dos principais sistemas do servidor, sendo eles:<br /><br /><img src=\"https://www.tibiawiki.com.br/images/f/f6/Dream_Matter.gif\" alt=\"Dream Matter.gif\" width=\"32\" height=\"32\" />Sistema de Upgrade (Refinamento), para saber mais visite:</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/5/5a/Hammer.gif\" alt=\"Hammer.gif\" width=\"32\" height=\"32\" /></p>\r\n<p style=\"text-align: center;\"><a href=\"../?refinament\"> Refine </a></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/f6/Dream_Matter.gif\" alt=\"Dream Matter.gif\" width=\"32\" height=\"32\" /> Sistema de Invas&otilde;es autom&aacute;ticas e aleat&oacute;rias, para saber mais visite:</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/thumb/2/22/Tibian_Parchment.gif/56px-Tibian_Parchment.gif\" srcset=\"/images/2/22/Tibian_Parchment.gif 1.5x\" alt=\"Tibian Parchment.gif\" width=\"56\" height=\"56\" /></p>\r\n<p style=\"text-align: center;\"><br /><a href=\"../?bossesraidsaleatorias\">&nbsp;Invas&otilde;es Aleat&oacute;rias </a></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/f6/Dream_Matter.gif\" alt=\"Dream Matter.gif\" width=\"32\" height=\"32\" />Ilhas | Bosses, para saber mais visite:</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/ff/Icone8.png\" alt=\"Icone8.png\" width=\"63\" height=\"65\" /></p>\r\n<p style=\"text-align: center;\"><br /><a href=\"../?islands\"> Ilhas &amp; Dolls </a><br /><br />E futuramente o sistema de tier e classifica&ccedil;&atilde;o ser&aacute; adicionado no servidor tamb&eacute;m.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/f4/Flames_of_the_Percht_Queen.gif\" alt=\"Flames of the Percht Queen.gif\" width=\"34\" height=\"34\" /> Novas criaturas foram adicionadas&nbsp;<img src=\"https://www.tibiawiki.com.br/images/f/f4/Flames_of_the_Percht_Queen.gif\" alt=\"Flames of the Percht Queen.gif\" width=\"34\" height=\"34\" /></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/e/ef/Execowtioner.gif\" alt=\"Execowtioner.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/7/70/Wardragon.gif\" alt=\"Wardragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/d/d7/Dragolisk.gif\" alt=\"Dragolisk.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/14/Mega_Dragon.gif\" alt=\"Mega Dragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/7/79/Souleater.gif\" alt=\"Souleater.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/1c/Moohtant.gif\" alt=\"Moohtant.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/abertura.png\" /></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Quarta-Feira, as 19:30 ser&aacute; dada a largada!</p>\r\n<p style=\"text-align: center;\">Bom jogo a todos!</p>',1,1756262968,1,11934,11934,1756333519,'0','','images/news/announcement.jpg',0),(6,'Atualizao 0.1','<p data-start=\"188\" data-end=\"218\"><strong data-start=\"191\" data-end=\"216\">&nbsp;</strong></p>\r\n<p><img style=\"text-align: start; cursor: pointer;\" src=\"https://static.tibia.com/images/news/balancingnews_abacuscalculations_250x214.png\" width=\"250\" height=\"214\" align=\"right\" hspace=\"10\" vspace=\"0\" /></p>\r\n<p data-start=\"188\" data-end=\"218\"><strong data-start=\"191\" data-end=\"216\">Stamina &amp; Experi&ecirc;ncia</strong></p>\r\n<ul data-start=\"219\" data-end=\"373\">\r\n<li data-start=\"219\" data-end=\"294\">\r\n<p data-start=\"221\" data-end=\"229\">Antes:</p>\r\n<ul data-start=\"232\" data-end=\"294\">\r\n<li data-start=\"232\" data-end=\"266\">\r\n<p data-start=\"234\" data-end=\"266\">Verde (+39:59h) &rarr;&nbsp;<strong data-start=\"252\" data-end=\"264\">100% EXP</strong></p>\r\n</li>\r\n<li data-start=\"269\" data-end=\"294\">\r\n<p data-start=\"271\" data-end=\"294\">Amarela &rarr;&nbsp;<strong data-start=\"281\" data-end=\"292\">50% EXP</strong></p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li data-start=\"295\" data-end=\"373\">\r\n<p data-start=\"297\" data-end=\"305\">Agora:</p>\r\n<ul data-start=\"308\" data-end=\"373\">\r\n<li data-start=\"308\" data-end=\"344\">\r\n<p data-start=\"310\" data-end=\"344\">Verde (+39:59h) &rarr;&nbsp;<strong data-start=\"328\" data-end=\"340\">130% EXP</strong>&nbsp;</p>\r\n</li>\r\n<li data-start=\"347\" data-end=\"373\">\r\n<p data-start=\"349\" data-end=\"373\">Amarela &rarr;&nbsp;<strong data-start=\"359\" data-end=\"371\">100% EXP</strong></p>\r\n</li>\r\n<li data-start=\"347\" data-end=\"373\"><strong data-start=\"359\" data-end=\"371\">Atacar o \"Treinador\" recupera 1m de stamina a cada 5 minutos.</strong></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<hr data-start=\"375\" data-end=\"378\" />\r\n<p data-start=\"380\" data-end=\"405\"><strong data-start=\"383\" data-end=\"403\">Loot &amp; Drop Rate</strong></p>\r\n<ul data-start=\"406\" data-end=\"484\">\r\n<li data-start=\"406\" data-end=\"444\">\r\n<p data-start=\"408\" data-end=\"444\">Drop rate aumentado de&nbsp;<strong data-start=\"431\" data-end=\"442\">1x  3x</strong></p>\r\n</li>\r\n<li data-start=\"445\" data-end=\"484\">\r\n<p data-start=\"447\" data-end=\"484\">Ajustado devido &agrave; escassez de loot.</p>\r\n</li>\r\n</ul>\r\n<hr data-start=\"486\" data-end=\"489\" />\r\n<p data-start=\"491\" data-end=\"525\"><strong data-start=\"494\" data-end=\"523\">Sistema de Teleport (/ir)</strong></p>\r\n<ul data-start=\"526\" data-end=\"655\">\r\n<li data-start=\"526\" data-end=\"578\">\r\n<p data-start=\"528\" data-end=\"578\">O comando&nbsp;<strong data-start=\"538\" data-end=\"545\">/ir</strong>&nbsp;voltou ao estilo&nbsp;<strong data-start=\"563\" data-end=\"575\">cl&aacute;ssico</strong>.</p>\r\n</li>\r\n<li data-start=\"579\" data-end=\"655\">\r\n<p data-start=\"581\" data-end=\"655\">Basta digitar&nbsp;<strong data-start=\"595\" data-end=\"610\">/ir [local]</strong>&nbsp;direto, sem precisar abrir a janela modal.</p>\r\n</li>\r\n</ul>\r\n<hr data-start=\"657\" data-end=\"660\" />\r\n<p data-start=\"662\" data-end=\"694\"><strong data-start=\"665\" data-end=\"692\">Reset Task (!resetTask)</strong></p>\r\n<ul data-start=\"695\" data-end=\"764\">\r\n<li data-start=\"695\" data-end=\"729\">\r\n<p data-start=\"697\" data-end=\"729\">Valor antigo:&nbsp;<strong data-start=\"711\" data-end=\"727\">2k por level</strong></p>\r\n</li>\r\n<li data-start=\"730\" data-end=\"764\">\r\n<p data-start=\"732\" data-end=\"764\">Novo valor:&nbsp;<strong data-start=\"744\" data-end=\"760\">1k por level</strong>&nbsp;</p>\r\n</li>\r\n</ul>\r\n<hr data-start=\"766\" data-end=\"769\" />\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\" data-start=\"771\" data-end=\"820\">&nbsp;Bom jogo a todos e aproveitem as novidades!</p>',1,1756430042,1,11934,11934,1756430160,'0','','images/news/announcement.jpg',0),(7,'Alteraes & Balanceamentos #01','<p style=\"text-align: center;\" data-start=\"113\" data-end=\"184\"><strong>Altera&ccedil;&otilde;es &amp; Balanceamentos #01</strong></p>\r\n<p>&nbsp;</p>\r\n<ul style=\"list-style-type: square;\" data-start=\"186\" data-end=\"645\">\r\n<li data-start=\"186\" data-end=\"275\">\r\n<p data-start=\"188\" data-end=\"275\">O valor da bless, que antes era de 400 gps por level, passa a ser de 300 gps por level.</p>\r\n<img style=\"cursor: pointer;\" src=\"https://static.tibia.com/images/news/balancingnews_abacuscalculations_250x214.png\" width=\"250\" height=\"214\" align=\"right\" hspace=\"10\" vspace=\"0\" /></li>\r\n<li data-start=\"276\" data-end=\"364\">\r\n<p data-start=\"278\" data-end=\"364\">O custo do reset task, que antes era de 1k de gps por level, passa a ser de 0.5k de gps por level.</p>\r\n</li>\r\n<li data-start=\"276\" data-end=\"364\">Os bosses de reward chest tamb&eacute;m tiveram seus drops corrigidos, visto que bosses de respawn estavam bugados e n&atilde;o dropavam loots.</li>\r\n<li data-start=\"365\" data-end=\"515\">\r\n<p data-start=\"367\" data-end=\"515\">O feiti&ccedil;o <strong><em data-start=\"377\" data-end=\"389\">exori bash</em></strong> agora possui range definido de 5 sqm. Anteriormente era poss&iacute;vel utiliz&aacute;-lo fora da tela, sem necessidade de vis&atilde;o do alvo.</p>\r\n</li>\r\n<li data-start=\"516\" data-end=\"645\">\r\n<p data-start=\"518\" data-end=\"645\">A experi&ecirc;ncia em party e solo foi corrigida. Agora o sistema verifica corretamente os stages de experi&ecirc;ncia e a party shared.</p>\r\n</li>\r\n<li data-start=\"516\" data-end=\"645\">O fator de recupera&ccedil;&atilde;o da stamina foi alterado, agora a cada 2 minutos on-line na protection zone recupera 1 ponto de stamina&nbsp;<strong>caso a stamina esteja abaixo de 40:00 horas,&nbsp;</strong>caso a stamina esteja acima de 40 horas, seu fator de recupera&ccedil;&atilde;o &eacute; de&nbsp;<strong>5 minutos para 1.<br /><br />Em breve o sistema de task ser&aacute; atualizado, as tasks ser&atilde;o padronizadas e classificadas como \"f&aacute;ceis\", \"m&eacute;dias\" e \"dif&iacute;ceis\" padronizando tamb&eacute;m o valor dos resets.<br /><br />- Bom jogo a todos!<br /><br /><br /></strong></li>\r\n</ul>',1,1756534219,1,11934,11934,1756534449,'0','','images/news/announcement.jpg',0),(9,'Alteraes & Balanceamentos #02','<p><strong>O servidor foi reiniciado as 15:40 para as seguintes altera&ccedil;&otilde;es:</strong></p>\r\n<ol>\r\n<li><strong>O sistema de task foi modificado.<br /></strong><br />Agora, as tasks ser&atilde;o resetadas automaticamente ap&oacute;s 24 horas de cooldown, al&eacute;m disso o valor do !resetTask foi alterado novamente para 6x o valor da recompensa.<br /><br /><strong>Ex:&nbsp;</strong>Suponhamos que o jogador fa&ccedil;a 3x a task de minotauros e receba 10k de recompensa por cada task, (fazendo 3x receber&aacute; 30k) al&eacute;m da experi&ecirc;ncia e pontos de task.<br />Se o jogador optar por reseta-l&aacute;, ele ter&aacute; que pagar 60k, ou seja ele estar&aacute; pagando pela experi&ecirc;ncia que vai adquirir.&nbsp;<br /><br />Em contratempo, se o intuito do jogador for farmar dinheiro com a task, ele poder&aacute; fazer 3x a task, aguardar 24 horas e fazer novamente.<br /><img style=\"cursor: pointer;\" src=\"https://static.tibia.com/images/news/news_fixes_243x200.png\" width=\"243\" height=\"200\" align=\"right\" hspace=\"8\" vspace=\"10\" /><br /><br /></li>\r\n<li><strong>Novas tasks foram adicionadas e as tasks existentes sofreram altera&ccedil;&otilde;es.<br /></strong><br />A quantidade de criaturas, recompensa e experi&ecirc;ncia de cada task foi modificada.<br /><br /></li>\r\n<li><strong>A runa Dharmas Caos Rune sofreu uma leve altera&ccedil;&atilde;o.</strong><br /><br />A voca&ccedil;&atilde;o&nbsp;<strong>MS</strong>&nbsp;tem um b&ocirc;nus de dano de 13,5% a mais que&nbsp;<strong>ED&nbsp;</strong>em runas comuns como&nbsp;<strong>DD, FM, HOLY e SD<br /><br /></strong>al&eacute;m disso podem usar a Dharmas que &eacute; uma runa exclusiva de MS.<br /><br />Por&eacute;m, depois de v&aacute;rios testes percebemos que a dharmas estava totalmente desbalanceada, o intuito &eacute; que ela seja mais forte que as runas comuns, por&eacute;m o seu dano estava 126,19% mais forte do que uma runa comum.<br /><br /><strong>Ex:</strong>&nbsp;2 personagens foram criados (ED e MS), ambos com level 140 e 100 de magic level e obtivemos os seguintes resultados.<br /><br />O dano da DD do MS sobre o ED foi de 420 (aproximadamente +13,5%)<br />O dano da DD do ED sobre o MS foi de 370 (aproximadamente - 13,5%)<br /><br />O dano da Dharmas sobre o ED foi de 800 ~ 950 (aproximadamente +126,19% a mais que o dano da DD)<br />Com isso reduzimos o dano da Dharmas para 66,6% a mais do que o dano da DD e outras runas comuns.<br /><br /></li>\r\n<li><strong>O food infinito foi corrigido e agora est&aacute; funcionando 100%.<br /></strong></li>\r\n<li><strong>A royal spear agora passou a ser um item de quest, pode ser obtida em elven (rivendell) na estatua ao lado da bancada de foods.<br /></strong><strong><br /><br /><br /><br />Bom jogo a todos!</strong></li>\r\n</ol>',1,1756580792,1,11934,0,0,'0','','',0),(10,'Alteraes & Balanceamentos #03','<p><strong>No pr&oacute;ximo server-save </strong>as seguintes modifica&ccedil;&otilde;es entrar&atilde;o em vigor:</p>\r\n<ol>\r\n<li>Agora &eacute; poss&iacute;vel ver as ilhas que voc&ecirc; tem acesso atrav&eacute;s do comando !stats<br /><br /></li>\r\n<li>O tempo da XP Boost agora &eacute; exibido ao usar o comando !boost (abre uma janela que exibe)<br /><br /></li>\r\n<li>A mana/hp agora &eacute; regenerada mesmo estando na &aacute;rea de prote&ccedil;&atilde;o (o fator de recupera&ccedil;&atilde;o dentro e fora do pz &eacute; o mesmo.</li>\r\n<li>As seguintes criaturas tiveram 20% do seu dano reduzido.<br /><br /><img src=\"https://www.tibiawiki.com.br/images/b/ba/Dawnfire_Asura.gif\" alt=\"Dawnfire Asura.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/9/9a/Frost_Flower_Asura.gif\" alt=\"Frost Flower Asura.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/b/b4/Midnight_Asura.gif\" alt=\"Midnight Asura.gif\" width=\"64\" height=\"64\" /></li>\r\n<li>As seguintes criaturas tiveram um aumento de 20% em seu dano e 15% em experi&ecirc;ncia.<br /><br /><img src=\"https://www.tibiawiki.com.br/images/a/a0/Faceless_Bane.gif\" alt=\"Faceless Bane.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/f/fa/Sphinx.gif\" alt=\"Sphinx.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/12/Crypt_Warden.gif\" alt=\"Crypt Warden.gif\" width=\"64\" height=\"64\" /><br /><br /></li>\r\n<li>As magias \"exori min san\", \"exori san\" e \"exevo mas san\" foram modificadas.<br /><br />Exori Min San -&gt; 15% de dano reduzido (auemtnamos a varia&ccedil;&atilde;o)<br /><br />Exori San -&gt; 20% a mais de dano (reduzimos a varia&ccedil;&atilde;o)<br /><br />Exevo Mas San -&gt; 20% a menos de cooldown (3,5s -&gt; 2,8s)<br /><br /></li>\r\n</ol>\r\n<p><strong>As altera&ccedil;&otilde;es entrar&atilde;o em vigor no pr&oacute;ximo server save, apenas o !stats e !boost est&atilde;o dispon&iacute;veis at&eacute; o momento.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp; &nbsp; &nbsp;Bom jogo a todos!</strong></p>',1,1756756488,1,11934,11934,1756756620,'0','','images/news/announcement.jpg',0),(11,'Alteraes & Balanceamentos #04','<p><strong>Os itens Lion&nbsp;</strong>tiveram seu level de uso reduzido de&nbsp;<strong>300&nbsp;</strong>para&nbsp;<strong>250.<br /><br /></strong></p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/8/86/Lion_Spangenhelm.gif\" alt=\"Lion Spangenhelm.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/3/3e/Lion_Plate.gif\" alt=\"Lion Plate.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/b/bc/Lion_Shield.gif\" alt=\"Lion Shield.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/b/b8/Lion_Longsword.gif\" alt=\"Lion Longsword.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/a/a7/Lion_Longbow.gif\" alt=\"Lion Longbow.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/e/eb/Lion_Spellbook.gif\" alt=\"Lion Spellbook.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/8/89/Lion_Axe.gif\" alt=\"Lion Axe.gif\" width=\"32\" height=\"32\" /><br /><br /></p>\r\n<p><strong>Os itens Falcon</strong> tiveram seu level de uso reduzido de <strong>350</strong> para <strong>300</strong>.<br /><br /></p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/b/b9/Falcon_Coif.gif\" alt=\"Falcon Coif.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/f/fc/Falcon_Bow.gif\" alt=\"Falcon Bow.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/2/2c/Falcon_Greaves.gif\" alt=\"Falcon Greaves.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/d/dc/Falcon_Plate.gif\" alt=\"Falcon Plate.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/2/29/Falcon_Shield.gif\" alt=\"Falcon Shield.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/e/ef/Falcon_Escutcheon.gif\" alt=\"Falcon Escutcheon.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/1/16/Falcon_Battleaxe.gif\" alt=\"Falcon Battleaxe.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/4/48/Falcon_Mace.gif\" alt=\"Falcon Mace.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/1/17/Falcon_Wand.gif\" alt=\"Falcon Wand.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/6/61/Falcon_Rod.gif\" alt=\"Falcon Rod.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/6/65/Falcon_Circlet.gif\" alt=\"Falcon Circlet.gif\" width=\"32\" height=\"32\" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Balan&ccedil;eamento de hunts.</strong></p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/6/63/Falcon_Paladin.gif\" alt=\"Falcon Paladin.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/19/Falcon_Knight.gif\" alt=\"Falcon Knight.gif\" width=\"64\" height=\"64\" /></p>\r\n<p><strong> As criaturas falcon</strong> tiveram seu dano minimo aumentado em 15% e sua vida aumentada em 5%.</p>\r\n<p>Em rela&ccedil;&atilde;o a xp|vida das criaturas os falcons tem uma experi&ecirc;ncia maior que outras devido a n&atilde;o terem tasks.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/b/b9/Cobra_Scout.gif\" alt=\"Cobra Scout.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/6/63/Cobra_Assassin.gif\" alt=\"Cobra Assassin.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/4/43/Cobra_Vizier.gif\" alt=\"Cobra Vizier.gif\" width=\"64\" height=\"64\" /></p>\r\n<p><strong>As criaturas Cobras</strong> tiveram sua vida reduzida em 10%.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bom jogo a todos!</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',1,1756819938,1,11934,11934,1756819961,'0','','images/news/announcement.jpg',0),(12,'Alteraes & Balanceamentos #05','<p>As seguintes modifica&ccedil;&otilde;es foram aplicadas:</p>\r\n<p>A magia \'exori gran\' teve o custo de mana reduzido de 300 pra 220.</p>\r\n<p>O dano das runas DD, FM, HOLY, SD, STT (terra) foi aumentado em 10% para druids e reformulada para ELFOS e RP.</p>\r\n<p>As seguintes criaturas tiveram sua EXP modificada:</p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/7/70/Wardragon.gif\" alt=\"Wardragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/14/Mega_Dragon.gif\" alt=\"Mega Dragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/d/d7/Dragolisk.gif\" alt=\"Dragolisk.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>Em breve novo patch com atualiza&ccedil;&otilde;es de hunts e criaturas.</p>\r\n<p>&nbsp;</p>',1,1756927631,1,11934,0,0,'0','','',0),(13,'Alteraes & Balanceamentos #05','<p>As seguintes modifica&ccedil;&otilde;es foram aplicadas:</p>\r\n<p>A magia \'exori gran\' teve o custo de mana reduzido de 300 pra 220.</p>\r\n<p>O dano das runas DD, FM, HOLY, SD, STT (terra) foi aumentado em 10% para druids e reformulada para ELFOS e RP.</p>\r\n<p>As seguintes criaturas tiveram sua EXP modificada:</p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/7/70/Wardragon.gif\" alt=\"Wardragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/14/Mega_Dragon.gif\" alt=\"Mega Dragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/d/d7/Dragolisk.gif\" alt=\"Dragolisk.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>Em breve novo patch com atualiza&ccedil;&otilde;es de hunts e criaturas.</p>\r\n<p>&nbsp;</p>',1,1756934656,1,11934,0,0,'0','','',0),(14,'Alteraes & Balanceamentos #05.2','<p>As seguintes criaturas foram modificadas.</p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/1/19/Falcon_Knight.gif\" alt=\"Falcon Knight.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/6/63/Falcon_Paladin.gif\" alt=\"Falcon Paladin.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>Dano base -&gt; Aumentado em 15%</p>\r\n<p>Experi&ecirc;ncia -&gt; Reduzida em 20%</p>\r\n<p>Life -&gt; Aumentada em 10%</p>\r\n<p>Agora &eacute; poss&iacute;vel passar no teleport sendo level 150 ou mais, antes s&oacute; era poss&iacute;vel passar no level 250+.<br /><br /><br /><img src=\"https://www.tibiawiki.com.br/images/b/b9/Cobra_Scout.gif\" alt=\"Cobra Scout.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/4/43/Cobra_Vizier.gif\" alt=\"Cobra Vizier.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/6/63/Cobra_Assassin.gif\" alt=\"Cobra Assassin.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>Experi&ecirc;ncia -&gt; Aumentada em 10%</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/1/19/Hydra.gif\" alt=\"Hydra.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/b/b2/Frost_Dragon.gif\" alt=\"Frost Dragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/9/97/Dragon_Lord.gif\" alt=\"Dragon Lord.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/4/4d/Serpent_Spawn.gif\" alt=\"Serpent Spawn.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>&nbsp;Essas criaturas n&atilde;o correm mais quando est&atilde;o com a vida abaixo de 10%.</p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/7/70/Behemoth.gif\" alt=\"Behemoth.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/7/70/Behemoth.gif\" alt=\"Behemoth.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>&nbsp;Life -&gt; Reduzida em 15%</p>\r\n<p><img src=\"https://www.tibiawiki.com.br/images/e/e9/Cyclops_Drone.gif\" alt=\"Cyclops Drone.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/1d/Cyclops_Smith.gif\" alt=\"Cyclops Smith.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>&nbsp;Aumento significativo de criaturas nos respawns de Cyc2 e Rhun!<br /><br /></p>\r\n<p>&nbsp;Os respawns de mino1, yeti, uruk-hai tiveram um aumento significativo de criaturas.</p>\r\n<p>&nbsp;Foi aberto uma passagem no muro que interligava Belfallas com Anfallas sendo poss&iacute;vel chegar na cidade a p&eacute; (free).</p>\r\n<p>&nbsp;Ao leste de belfallas foi adicionada uma ponte que d&aacute; acesso a cidade de Minas Tirith a p&eacute; (free).<br /><br />&nbsp;O Slot Machine foi liberado no andar -1 da roleta.&nbsp;</p>\r\n<p>&nbsp;Para ganhar &eacute; necess&aacute;rio ter uma combina&ccedil;&atilde;o de 3 itens id&ecirc;nticos horizontalmente.</p>\r\n<p><br /><br />&nbsp; &nbsp; &nbsp; &nbsp;<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/rouletteMachine.png\" /></p>\r\n<p>&nbsp;</p>\r\n<p>Bom jogo a todos!</p>',1,1756936521,1,11934,0,0,'0','','',0),(15,'Alteraes & Balanceamentos #06','<p>No server save do dia 05/09 as seguintes altera&ccedil;&otilde;es ser&atilde;o aplicadas:<br /><br />&nbsp;Os respectivos respawns tiveram um aumento significativo de criaturas.<br /><br /></p>\r\n<p>- Serpent Spawns ao Oeste de Umbar.<br /><img class=\"NewsImageLinkThumbnail\" src=\"https://static.tibia.com/images/news/news_fixes_243x200.png\" width=\"243\" height=\"200\" align=\"right\" hspace=\"8\" vspace=\"10\" /><br />- Uruloki e Dracos ao Sul de Umbar.<br /><br />- Minotauros aos arredores de mino1.<br /><br />- Black Knights nos BKs de Bree.<br /><br />- Wyverns na hunt ao norte de Bree.<br /><br />- Dragon e Dragon Lords ao norte de Bree.<br /><br />- Yetis em forodwaith e forochel.<br /><br />- Lichs na cave ao norte de Mordor.<br /><br />- Behemoths no subsolo do vulc&atilde;o em Orodruin.<br /><br /><br />&nbsp;Em breve teremos novos bosses!<br /><br /><br />&nbsp;Bom jogo a todos!<br /><br /></p>',1,1757042426,1,11934,11934,1757042494,'0','','images/news/announcement.jpg',0),(16,'Alteraes & Balanceamentos #07','<p style=\"text-align: center;\">&nbsp; &nbsp;No pr&oacute;ximo server save as voca&ccedil;&otilde;es melee ter&atilde;o seu ataque b&aacute;sico modificado.</p>\r\n<p style=\"text-align: center;\">&nbsp; &nbsp;Antes o ataque b&aacute;sico era rand&ocirc;mico entre [0, valor m&aacute;ximo]&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp; &nbsp;Agora foi alterado para [30% do valor m&aacute;x, valor m&aacute;ximo]</p>\r\n<p style=\"text-align: center;\">&nbsp; &nbsp;A hunt de Dragons ao norte de Bree no subsolo foi aumentada.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/dragonbree.png\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp; &nbsp;Foi adicionado uma cave de Spirit of Fires e Hellfire Fighters no subsolo de Dragons em Bree.</p>\r\n<p style=\"text-align: center;\"><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/spirits.png\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp; &nbsp; Foi adicionado um respawn de Gazer Spectres ao Oeste do respawn de Shadow Spectres, entre Eriador e Argond.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/gazer spectres.png\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp; &nbsp; Bom jogo a todos!</p>',1,1757134750,1,11934,11934,1757134762,'0','','images/news/announcement.jpg',0),(17,'Alteraes & Balanceamentos #08','<p style=\"text-align: center;\">A partir de agora, os itens ter&atilde;o novos requisitos de n&iacute;vel para uso:</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/e/e4/Heavily_Bound_Book.gif\" alt=\"Heavily Bound Book.gif\" width=\"21\" height=\"21\" />&nbsp; Itens Cobras: N&iacute;vel 220+</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/1/1c/Cobra_Axe.gif\" alt=\"Cobra Axe.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/6/6f/Cobra_Sword.gif\" alt=\"Cobra Sword.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/2/2f/Cobra_Club.gif\" alt=\"Cobra Club.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/9/9e/Cobra_Boots.gif\" alt=\"Cobra Boots.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/5/5b/Cobra_Hood.gif\" alt=\"Cobra Hood.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/5/57/The_Cobra_Amulet.gif\" alt=\"The Cobra Amulet.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/6/6c/Cobra_Crossbow.gif\" alt=\"Cobra Crossbow.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/4/46/Cobra_Rod.gif\" alt=\"Cobra Rod.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/f/fa/Cobra_Wand.gif\" alt=\"Cobra Wand.gif\" width=\"32\" height=\"32\" /></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/e/e4/Heavily_Bound_Book.gif\" alt=\"Heavily Bound Book.gif\" width=\"21\" height=\"21\" />&nbsp; &nbsp;Itens Lions: N&iacute;vel 250+</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/8/86/Lion_Spangenhelm.gif\" alt=\"Lion Spangenhelm.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/3/3e/Lion_Plate.gif\" alt=\"Lion Plate.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/9/9f/Lion_Rod.gif\" alt=\"Lion Rod.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/a/a7/Lion_Wand.gif\" alt=\"Lion Wand.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/b/b8/Lion_Longsword.gif\" alt=\"Lion Longsword.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/d/db/Lion_Hammer.gif\" alt=\"Lion Hammer.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/8/89/Lion_Axe.gif\" alt=\"Lion Axe.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/a/a7/Lion_Longbow.gif\" alt=\"Lion Longbow.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/b/bc/Lion_Shield.gif\" alt=\"Lion Shield.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/e/eb/Lion_Spellbook.gif\" alt=\"Lion Spellbook.gif\" width=\"32\" height=\"32\" /></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/e/e4/Heavily_Bound_Book.gif\" alt=\"Heavily Bound Book.gif\" width=\"21\" height=\"21\" />&nbsp; &nbsp;Itens Falcon: N&iacute;vel 300+</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/b/b9/Falcon_Coif.gif\" alt=\"Falcon Coif.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/6/65/Falcon_Circlet.gif\" alt=\"Falcon Circlet.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/2/2c/Falcon_Greaves.gif\" alt=\"Falcon Greaves.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/6/61/Falcon_Rod.gif\" alt=\"Falcon Rod.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/1/17/Falcon_Wand.gif\" alt=\"Falcon Wand.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/4/42/Falcon_Longsword.gif\" alt=\"Falcon Longsword.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/4/48/Falcon_Mace.gif\" alt=\"Falcon Mace.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/1/16/Falcon_Battleaxe.gif\" alt=\"Falcon Battleaxe.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/f/fc/Falcon_Bow.gif\" alt=\"Falcon Bow.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/2/29/Falcon_Shield.gif\" alt=\"Falcon Shield.gif\" width=\"32\" height=\"32\" /><img src=\"https://www.tibiawiki.com.br/images/e/ef/Falcon_Escutcheon.gif\" alt=\"Falcon Escutcheon.gif\" width=\"32\" height=\"32\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/c/c3/Tibiapedia.gif\" alt=\"Tibiapedia.gif\" width=\"32\" height=\"32\" /><strong> O </strong>boss<strong> Nimrion </strong>(task [200 pontos]) foi adicionado em Anfallas.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/bossNimrion.png\" width=\"826\" height=\"585\" /></p>',1,1757427311,1,11934,11934,1757427352,'0','','images/news/announcement.jpg',0),(18,'Alteraes & Balanceamentos #09','<p><strong>## Sistema de Morte</strong></p>\r\n<p>- Perca de experiencia: Aumentada em 10% ao morrer para criaturas</p>\r\n<p>&nbsp;</p>\r\n<p><strong>## Sistema de Stamina</strong></p>\r\n<p>- Funcionamento 100% otimizado</p>\r\n<p>- Training (verde/amarela): 1 minuto a cada 5 minutos</p>\r\n<p><img style=\"cursor: pointer;\" src=\"https://static.tibia.com/images/news/balancingnews_abacuscalculations_250x214.png\" width=\"250\" height=\"214\" align=\"right\" hspace=\"10\" vspace=\"0\" /></p>\r\n<p>&nbsp;</p>\r\n<p>- Protection Zone:</p>\r\n<p>&nbsp; - Stamina laranja (&lt;40h): 1 minuto a cada 3 minutos</p>\r\n<p>&nbsp; - Stamina normal (&ge;40h): 1 minuto a cada 5 minutos</p>\r\n<p>&nbsp;</p>\r\n<p><strong>## Respawns aumentados</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>### Harlond</strong></p>\r\n<p>- Oxyurus 1, 2 e 3</p>\r\n<p>- Enyds</p>\r\n<p>- Terminator</p>\r\n<p>- Medusas (Necromancer Tower)</p>\r\n<p>- Destroyers</p>\r\n<p>&nbsp;</p>\r\n<p><strong>### Bree</strong></p>\r\n<p>- Hydra 1, 2 e 3</p>\r\n<p>- Amazonas e Valquirias</p>\r\n<p><strong>### Slime 3</strong></p>\r\n<p>- Assassinos e Bandidos</p>\r\n<p>- Serpent Spawn</p>\r\n<p>- Demonios e Espiritos</p>\r\n<p>- Furias e Urulokis</p>\r\n<p>&nbsp;</p>\r\n<p><strong>### Beleghost</strong></p>\r\n<p>- Serpent Spawn</p>\r\n<p>- Lizard Legionnaires</p>\r\n<p>&nbsp;</p>\r\n<p><strong>### Condado</strong></p>\r\n<p>- Minotauros 2</p>\r\n<p><strong>### Cidade Proibida</strong></p>\r\n<p>- Hand of Cursed Fates</p>\r\n<p>- Hellhounds</p>\r\n<p>&nbsp;</p>\r\n<p><strong>### Eriador/Argond</strong></p>\r\n<p>- Shadow Spectres</p>\r\n<p>- Stampors</p>\r\n<p><strong>### Forochel</strong></p>\r\n<p>- Dark Torturer</p>\r\n<p>&nbsp;</p>\r\n<p><strong>### Mordor</strong></p>\r\n<p>- Terror Birds</p>\r\n<p>&nbsp;</p>\r\n<p>Bom jogo!</p>',1,1757458415,1,11934,11934,1757458520,'0','','images/news/announcement.jpg',0),(19,'Ferumbras Ascendant!','<p style=\"text-align: center;\"><strong>Hoje as 21:30 Ferumbras Ascendant invadir&aacute; Dolguldur!</strong></p>\r\n<p style=\"text-align: center;\"><strong>Chame sua pt e venha fragar o primeiro hat do servidor!</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/ferumbrasAscendant.png\" /></p>',1,1757512307,1,11934,11934,1757521648,'0','','images/news/announcement.jpg',0),(20,'Alteraes & Balanceamentos #10','<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/1/14/Arena_Badge.gif\" alt=\"Arena Badge.gif\" width=\"32\" height=\"32\" /> No pr&oacute;ximo server save, dia 12/09, as seguintes modifica&ccedil;&otilde;es ser&atilde;o aplicadas:&nbsp;<img src=\"https://www.tibiawiki.com.br/images/1/14/Arena_Badge.gif\" alt=\"Arena Badge.gif\" width=\"32\" height=\"32\" /></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;<img src=\"https://www.tibiawiki.com.br/images/4/4e/Botany_Almanach.gif\" alt=\"Botany Almanach.gif\" width=\"32\" height=\"32\" /> As runas [Avalanche, Thunderstorm, Great Fireball, Stone Shower] tiveram seu dano aumentado em 10%.</p>\r\n<p style=\"text-align: center;\">Al&eacute;m disso, a escala de dano foi alterada: anteriormente escalavam 85% com Magic Level e 15% com Level, e agora escalam 70% com Magic Level e 30% com Level.&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/a/ab/Bar_of_Gold.gif\" alt=\"Bar of Gold.gif\" width=\"32\" height=\"32\" /> &nbsp;O Market foi ajustado e agora est&aacute; funcionando corretamente.&nbsp;<img src=\"https://www.tibiawiki.com.br/images/a/ab/Bar_of_Gold.gif\" alt=\"Bar of Gold.gif\" width=\"32\" height=\"32\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/f4/Flames_of_the_Percht_Queen.gif\" alt=\"Flames of the Percht Queen.gif\" width=\"34\" height=\"34\" /> Foi adicionada a op&ccedil;&atilde;o de ocultar as palavras de conjura&ccedil;&atilde;o de magias que apareciam em laranja no chat <img src=\"https://www.tibiawiki.com.br/images/f/f4/Flames_of_the_Percht_Queen.gif\" alt=\"Flames of the Percht Queen.gif\" width=\"34\" height=\"34\" /></p>\r\n<p style=\"text-align: center;\">(ex: exura, exori, etc.). Para ativar ou desativar essa fun&ccedil;&atilde;o, utilize o comando !hiddenspells.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/3/3e/Assassin_Doll.gif\" alt=\"Assassin Doll.gif\" width=\"32\" height=\"32\" /> Agora &eacute; poss&iacute;vel realizar compras na store (incluindo prey wildcards, boosts e outros itens) mesmo estando <img src=\"https://www.tibiawiki.com.br/images/3/3e/Assassin_Doll.gif\" alt=\"Assassin Doll.gif\" width=\"32\" height=\"32\" /></p>\r\n<p style=\"text-align: center;\">com PZ Lock.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Bom jogo!</p>',1,1757650447,1,11934,0,0,'0','','',0),(21,'King Zelos & Malboro.','<p style=\"text-align: center;\"><strong>Malboro, o H&aacute;lito de Morgoth.</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Criado nos prim&oacute;rdios pelos venenos de Morgoth, Malboro era uma criatura terrestre que habitava as florestas &uacute;midas do leste. Ap&oacute;s a Guerra da Ira e o rearranjo do mundo, ele foi arrastado para o lodo e ficou esquecido por eras em c&acirc;maras subterr&acirc;neas inundadas.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Agora, Malboro desperta nas profundezas alagadas sob Esgaroth, alimentando-se do lodo, carca&ccedil;as e da corrup&ccedil;&atilde;o que escorre das ru&iacute;nas antigas sob o Lago Longo. Seu h&aacute;lito p&uacute;trido apodrece madeira, pedra e carne, e os pescadores dizem que, &agrave;s vezes, a &aacute;gua ao redor da cidade borbulha com um fedor venenoso.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Uma antiga alavanca, forjada por servos de Morgoth, permanece oculta nas ru&iacute;nas submersas ao leste do lago, e apenas ela pode abrir o port&atilde;o enferrujado que conduz ao covil de Malboro.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/d/dc/Deep_Terror.gif\" alt=\"Deep Terror.gif\" width=\"64\" height=\"64\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>King Zelos, o Trono da Energia Negra</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Antigamente, Zelos foi um grande erudito de N&uacute;menor, obcecado pelos segredos da energia primordial que flui por Arda. Sua busca o levou a antigos grim&oacute;rios trazidos das ru&iacute;nas submersas de Valinor, onde encontrou fragmentos da ess&ecirc;ncia sombria deixada por Morgoth.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Aos poucos, a energia negra consumiu sua carne, sua alma e sua mente. Seus ossos tornaram-se cinzas presas por veios de luz escura, e seu cora&ccedil;&atilde;o foi substitu&iacute;do por um n&uacute;cleo de pura corrup&ccedil;&atilde;o. Seus olhos, vazios, ardem como fendas para um vazio al&eacute;m do mundo.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Hoje, Zelos reina sobre a Livraria de Energy, um lugar onde os livros murmuram em l&iacute;nguas mortas e o ar est&aacute; carregado de rel&acirc;mpagos negros que rasgam o sil&ecirc;ncio. Nenhuma chama acende ali &mdash; apenas sombras em forma de fa&iacute;scas percorrem os corredores.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Aqueles que o enfrentaram e falharam tiveram suas almas arrancadas e gravadas como palavras vivas nos pergaminhos flutuantes que orbitam seu trono, eternamente presas em um sussurro de dor.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/4/40/King_Zelos.gif\" alt=\"King Zelos.gif\" width=\"64\" height=\"64\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Ambos estar&atilde;o dispon&iacute;veis na rota&ccedil;&atilde;o no pr&oacute;ximo server-save.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>',1,1757703127,1,11934,0,0,'0','','',0),(23,'Kharos & Lost Souls','<p style=\"text-align: center;\">No server save de hoje foi adicionado a hunt do Ferumbras (Kharos).&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/9/97/Dragon_Lord.gif\" alt=\"Dragon Lord.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/7/70/Behemoth.gif\" alt=\"Behemoth.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/7/75/Demon.gif\" alt=\"Demon.gif\" width=\"64\" height=\"64\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Lost Souls em Mordor.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/4/49/Flimsy_Lost_Soul.gif\" alt=\"Flimsy Lost Soul.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/5/5f/Mean_Lost_Soul.gif\" alt=\"Mean Lost Soul.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/2/2f/Freakish_Lost_Soul.gif\" alt=\"Freakish Lost Soul.gif\" width=\"64\" height=\"64\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>',1,1757775626,1,11934,11934,1757775637,'0','','images/news/announcement.jpg',0),(24,'Aulmog & Morvandir','<p style=\"text-align: center;\">No server save de hoje 2 novos bosses de task foram adicionados,</p>\r\n<p style=\"text-align: center;\">Diferente dos bosses que j&aacute; existem, esses bosses consomem pontos de task (um valor consideravelmente alto) mas o intuito desss bosses &eacute; fazer com que o jogador fa&ccedil;a mais tasks, assim aumente os seus pontos e possa gasta-los de maneira eficaz.</p>\r\n<p style=\"text-align: center;\">Aulmog (slime3 | 200 pontos)<br /><br /><img src=\"https://www.tibiawiki.com.br/images/3/34/Shulgrax.gif\" alt=\"Shulgrax.gif\" width=\"64\" height=\"64\" /><br /><br /></p>\r\n<p style=\"text-align: center;\">Morvandir (mordor | 400 pontos)</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/0/0e/Tarbaz.gif\" alt=\"Tarbaz.gif\" width=\"64\" height=\"64\" /><br /><br /></p>\r\n<p style=\"text-align: center;\">Ambos os bosses dropam loots rares, como valar kilt, ornate legs, bow of cataclysm, etc.</p>\r\n<p style=\"text-align: center;\">A chance de drop de itens desses bosses &eacute; de 7 vezes mais que bosses de respawn.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img style=\"cursor: pointer;\" src=\"https://static.tibia.com/images/news/news_fixes_243x200.png\" width=\"243\" height=\"200\" align=\"right\" hspace=\"8\" vspace=\"10\" /></p>\r\n<p style=\"text-align: center;\"><strong>Corre&ccedil;&otilde;es &amp; Balanceamentos</strong>&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Devido a corre&ccedil;&atilde;o do hit b&aacute;sico (auto-attack) de rangeds (elfos e rps), a diamond arrow deixou de ter uma varia&ccedil;&atilde;o de dano, devido a essa altera&ccedil;&atilde;o sua f&oacute;rmula de PvP foi alterada e seu dano contra <strong>\"players\"</strong> foi reduzido em 30%, possibilitando o repot de outros mages.</p>',1,1758029570,1,11934,11934,1758029880,'0','','images/news/announcement.jpg',0),(25,'Atualizaes e Balanceamentos #11','<p style=\"text-align: center;\"><strong>A&nbsp;partir do pr&oacute;ximo server save (19/09) as seguintes altera&ccedil;&otilde;es ser&atilde;o aplicadas</strong>.<br /><br /></p>\r\n<p style=\"text-align: center;\"><strong>A f&oacute;rmula do exori bash foi corrigida.</strong></p>\r\n<p style=\"text-align: center;\">Antes o bash tinha um dano est&aacute;tico (n&atilde;o alterava, o dano causado era sempre o mesmo), agora ele altera entre um valor m&iacute;nimo e m&aacute;ximo randomicamente.</p>\r\n<p style=\"text-align: center;\"><strong>Utamo gran grav adicionado.</strong></p>\r\n<p style=\"text-align: center;\">O utamo gran grav reduz 15% de prote&ccedil;&atilde;o contra tudo e s&oacute; pode ser usado por chaos knights.</p>\r\n<p style=\"text-align: center;\"><strong>O auto-ataque dos Elfos e RP\'s foi corrigido.</strong></p>\r\n<p style=\"text-align: center;\">No inicio do servidor os voca&ccedil;&otilde;es ranged sofriam com o miss, devido a uma corre&ccedil;&atilde;o o dano minimo do ataque b&aacute;sico das voca&ccedil;&otilde;es ranged foi alterado pra dano minimo equivalente a 50% do dano m&aacute;ximo.</p>\r\n<p style=\"text-align: center;\">Suponhamos que o auto ataque de um jogador seja de 1000, o auto ataque mais fraco hitaria 500.</p>\r\n<p style=\"text-align: center;\">Foi alterado para que o dano m&iacute;nimo seja de pelo menos 35% do valor m&aacute;ximo, ou seja 1000 (35% = 350), lembrando que essas altera&ccedil;&otilde;es ser&atilde;o v&aacute;lidas apenas para&nbsp;<strong>PvP</strong>.</p>\r\n<p style=\"text-align: center;\"><br /><strong>Runas single target.</strong></p>\r\n<p style=\"text-align: center;\">O scaling das runas foi alterado.<br />Suponhamos que um personagem level 300 com magic level 100 hitasse 500 na runa, anteriormente com o magic level 120 esse dano aumentaria pra 540, devido a altera&ccedil;&atilde;o, o dano agora aumentaria pra 560.</p>\r\n<p style=\"text-align: center;\">Em termos de porcentagem, o valor foi alterado de 8% pra 13% a mais.</p>\r\n<p><img style=\"cursor: pointer;\" src=\"https://static.tibia.com/images/news/news_fixes_243x200.png\" width=\"243\" height=\"200\" align=\"right\" hspace=\"8\" vspace=\"10\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>Might Rings.</strong></p>\r\n<p style=\"text-align: center;\">Agora ser&aacute; poss&iacute;vel comprar might rings no npc de rings em minas.</p>\r\n<p style=\"text-align: center;\">Cada might ring custar&aacute; 30k (600k a backpack com 20), o&nbsp;<strong>might ring ter&aacute; 10 cargas e proteger&aacute; 5% contra f&iacute;sico, holy, death, fire, ice, earth e energy.</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>Lightvalle.</strong></p>\r\n<p style=\"text-align: center;\">O mapa de lightvalle foi refeito e as criaturas tradicionais foram adicionadas (<strong>Town Keeper, Holy Keeper e Truth Keeper</strong>), com o intuito do up solo para mages, (up solo single target)</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/a/a3/Acolyte_of_the_Cult.gif\" alt=\"Acolyte of the Cult.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/9/91/Enlightened_of_the_Cult.gif\" alt=\"Enlightened of the Cult.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/0/0f/Ferumbras.gif\" alt=\"Ferumbras.gif\" width=\"64\" height=\"64\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><br /><br /><img style=\"display: block; margin-left: auto; margin-right: auto; border: 5px solid black;\" src=\"../template/offlike/imagens/true lightvalle.png\" width=\"702\" height=\"530\" /></p>',1,1758255233,1,11934,11934,1758290686,'0','','images/news/announcement.jpg',0);
